    "WA - Investigation of contaminants in feeds and fish at FWS Pacific Region National
    Fish Hatcheries and the ramifications to human and ecological health",nt"tracking_summary":
    {ntt"total": 5,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:42:28.596904",nt"name": "wa-investigation-of-contaminants-in-feeds-and-fish-at-fws-pacific-region-national-fish-hat",nt"isopen":
    false,nt"url": null,nt"notes": "Returning adult salmon and steelhead were
    sampled at three National Fish Hatcheries (NFHs); Warm Springs NFH (spring Chinook,
    Oncorhynchus tshawytscha), Quilcene NFH (coho, O. kisutch) and Quinault NFH (steelhead,
    O. mykiss). Fifteen males and 15 females from each hatchery were collected during
    spawning and a portion of muscle tissue, including skin, was sampled from the same
    area on each fish. Tissue samples were pooled so that there were three composite
    samples (five fish per composite) from each sex. Samples were taken on spawning
    days at each hatchery, August 30, 2006, October 24, 2006 and December 13, 2006,
    respectively. Samples were analyzed for congener specific polychlorinated biphenyls
    (PCBs), dioxins & furans, organochlorine pesticides, polybrominated diphenyl ethers
    (PBDEs) and metals. The levels of the contaminants varied by fish species and could
    be a result of migration route, diet, taxa-specific physiology and age at return.
    Eggs and unfed fry were also tested for the same contaminants. Eggs generally had
    contaminant levels higher than the adult females. Levels of contaminants in the
    unfed fry were generally lower than the eggs except for the fish at Quinault NFH.
    Feeds were collected throughout the rearing period for each species sampled and
    analyzed for the same contaminants as those in the fish.",nt"license_title":
